// Decompose returns the canonical decomposition of a codepoint.
// Returns false if no decomposition exists.
// HarfBuzz equivalent: hb_ucd_decompose()
func Decompose(cp Codepoint) (first, second Codepoint, ok bool) {
	// Handle Hangul algorithmically
	if cp >= 0xAC00 && cp < 0xAC00+11172 {
		si := cp - 0xAC00
		if si%28 != 0 {
			// LV,T
			first = 0xAC00 + (si/28)*28
			second = 0x11A7 + si%28
		} else {
			// L,V
			first = 0x1100 + si/588
			second = 0x1161 + (si%588)/28
		}
		return first, second, true
	}

	if d, exists := decompositionMap[cp]; exists {
		return d.First, d.Second, true
	}
	return 0, 0, false
}

// Compose returns the canonical composition of two codepoints.
// Returns false if no composition exists.
// HarfBuzz equivalent: hb_ucd_compose()
func Compose(first, second Codepoint) (composed Codepoint, ok bool) {
	// Handle Hangul algorithmically
	if first >= 0xAC00 && first < 0xAC00+11172 && second > 0x11A7 && second < 0x11A7+28 {
		if (first-0xAC00)%28 == 0 {
			// LV,T
			return first + (second - 0x11A7), true
		}
	} else if first >= 0x1100 && first < 0x1100+19 && second >= 0x1161 && second < 0x1161+21 {
		// L,V
		li := first - 0x1100
		vi := second - 0x1161
		return 0xAC00 + li*588 + vi*28, true
	}

	// Linear search (could be optimized with reverse map)
	for cp, d := range decompositionMap {
		if d.First == first && d.Second == second {
			return cp, true
		}
	}
	return 0, false
}

