// GetScript returns the Script for a codepoint.
// HarfBuzz equivalent: hb_ucd_script() using _hb_ucd_sc()
func GetScript(cp Codepoint) Script {
	sc := getScriptTag(cp)
	if idx, ok := scriptTagToIdx[sc]; ok {
		return idx
	}
	return ScriptUnknown
}

